      '<Note variant="warning">\n  Denne funksjonen er for øyeblikket under utvikling og vil snart være tilgjengelig.\n</Note>\n\nPropdock jobber med å utvikle en omfattende faktureringsoversikte for å gi deg full kontroll over dine økonomiske transaksjoner.\n\n## Hva kan du forvente?\n\nNår faktureringsoversikte-funksjonen er ferdig utviklet, vil du kunne:\n\n- Se en samlet oversikt over alle utstedte fakturaer\n- Filtrere fakturaer basert på status (betalt, ubetalt, forfalt)\n- Få innsikt i faktureringstrender og nøkkeltall\n- Eksportere faktureringsdata for videre analyse\n\n## Nåværende funksjoner\n\nMens vi jobber med å fullføre faktureringsoversikte, kan du allerede nyte godt av følgende funksjoner:\n\n- [Integrering med Poweroffice](integrere-med-poweroffice) for effektiv fakturahåndtering\n- [Sending av fakturaer](hvordan-sende-faktura) direkte fra Propdock\n\n## Oppdateringer\n\nVi jobber kontinuerlig med å forbedre og utvide funksjonaliteten i Propdock. Hold øye med våre oppdateringer for å få vite når faktureringsoversikte blir tilgjengelig.\n\nHvis du har spesifikke ønsker eller behov knyttet til faktureringsoversikte, ikke nøl med å [kontakte vårt supportteam](mailto:support@propdock.no). Din tilbakemelding er verdifull for oss i utviklingsprosessen.',
