    content:
      'Propdock gjør det enkelt å sende fakturaer direkte fra plattformen ved hjelp av Poweroffice-integrasjonen. Følg denne veiledningen for å sende din første faktura.\n\n<Prerequisites>\n\nFør du begynner, sørg for at du har:\n\n- En aktiv Propdock-konto\n- Fullført [integrasjonen med Poweroffice](integrere-med-poweroffice)\n\n</Prerequisites>\n\n## Steg 1: Gå til Leietaker-seksjonen\n\n1. Logg inn på din Propdock-konto.\n2. Naviger til **Leietaker**-seksjonen i hovedmenyen.\n\n<Image\n  alt="Leietaker-seksjonen i Propdock"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/84d87b75-d579-4284-5792-b3e056649200/public"\n  width={1200}\n  height={675}\n/>\n\n## Steg 2: Velg Faktura-funksjonen\n\nI Leietaker-seksjonen, finn og klikk på **Faktura**-knappen.\n\n<Image\n  alt="Faktura-knappen i Leietaker-seksjonen"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/c5227db5-80c9-4338-db79-7af0a381ea00/public"\n  width={800}\n  height={400}\n/>\n\n## Steg 3: Velg kunde og produkt\n\n1. Du vil nå se en liste over kunder hentet direkte fra Poweroffice.\n2. Velg ønsket kunde fra listen.\n3. Velg produktet eller tjenesten du vil fakturere for.\n\n<Image\n  alt="Velg kunde og produkt for fakturering"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/54883adb-75c6-4054-c1a7-5a1fd8c49f00/public"\n  width={1000}\n  height={600}\n/>\n\n## Steg 4: Fyll ut fakturadetaljer\n\n1. Angi forfallsdato for fakturaen.\n2. Fyll ut eventuelle andre nødvendige detaljer.\n\n<Image\n  alt="Fyll ut fakturadetaljer"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/4fd43369-170e-4cf4-0d0c-a6b3e80cdf00/public"\n  width={1000}\n  height={600}\n/>\n\n## Steg 5: Send fakturaen\n\nNår du har fylt ut all nødvendig informasjon, klikk på **Send faktura**-knappen.\n\n<Image\n  alt="Send faktura-knappen"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/b2e0ea90-973c-438e-3b11-0d98806ffe00/public"\n  width={800}\n  height={400}\n/>\n\n<Note variant="success">\n  Gratulerer! Du har nå sendt en faktura via Propdock og Poweroffice.\n</Note>\n\n## Verifisere sendt faktura\n\nFor å bekrefte at fakturaen er sendt og registrert korrekt:\n\n1. Logg inn på din Poweroffice-konto.\n2. Naviger til fakturamodulen.\n3. Du skal nå se den nylig sendte fakturaen i listen over sendte fakturaer.\n\n<Image\n  alt="Verifisere sendt faktura i Poweroffice"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/82135eee-4723-4574-9b92-018ef3218100/public"\n  width={1200}\n  height={675}\n/>\n\nHvis du støter på problemer eller har spørsmål om fakturering, ikke nøl med å [kontakte vår support](mailto:support@propdock.no).',
