    content:
      'Propdock tilbyr en enkel integrasjon med Poweroffice for å effektivisere fakturaprosessen din. Følg denne veiledningen for å sette opp integrasjonen.\n\n<Prerequisites>\n\nFør du begynner, sørg for at du har:\n\n- En aktiv Propdock-konto\n- En aktiv Poweroffice-konto\n- Tilgang til å administrere integrasjoner i begge systemer\n\n</Prerequisites>\n\n## Steg 1: Åpne innstillinger i Propdock\n\n1. Logg inn på din Propdock-konto.\n2. Klikk på **Innstillinger** i toppmenyen.\n\n<Image\n  alt="Innstillinger-siden i Propdock"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/04f86917-3c64-465f-e3ce-735796271900/public"\n  width={1200}\n  height={675}\n/>\n\n## Steg 2: Koble til Poweroffice\n\nPå innstillingssiden finner du en seksjon for integrasjoner. \n\n1. Finn Poweroffice-seksjonen.\n2. Klikk på **Koble til** knappen ved siden av Poweroffice-logoen.\n\n<Image\n  alt="Koble til Poweroffice-knappen i Propdock"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/b9d84514-7ed3-4b99-1ce0-780e1cc41400/public"\n  width={800}\n  height={400}\n/>\n\n## Steg 3: Autentisering hos Poweroffice\n\nEtter å ha klikket på "Koble til", blir du videresendt til Poweroffice sin innloggingsside.\n\n1. Skriv inn dine Poweroffice-påloggingsdetaljer.\n2. Godkjenn tilgangen for Propdock når du blir bedt om det.\n\n<Image\n  alt="Poweroffice innloggingsside"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/4b2f2231-a8ce-4fe9-f42e-fe2a9e7c7c00/public"\n  width={1000}\n  height={600}\n/>\n\n## Steg 4: Bekreft integrasjonen\n\nEtter vellykket autentisering blir du sendt tilbake til Propdock.\n\n1. Du vil se en bekreftelsesmelding om at integrasjonen er fullført.\n2. Poweroffice-seksjonen i innstillingene vil nå vise "Tilkoblet" status.\n\n<Note variant="success">\n  Gratulerer! Du har nå koblet Propdock til Poweroffice. Du kan begynne å sende fakturaer direkte fra Propdock.\n</Note>\n\n## Neste steg\n\nNå som du har satt opp integrasjonen, kan du utforske følgende funksjoner:\n\n- [Hvordan sende faktura via Poweroffice](hvordan-sende-faktura-poweroffice)\n- [Oversikt over fakturering i Propdock](fakturering-oversikt)\n\nHvis du støter på problemer eller har spørsmål, ikke nøl med å [kontakte vår support](mailto:support@propdock.no).',
