    content:
      'Velkommen til Propdock – den neste generasjonen innen eiendomsadministrasjon. Vi kombinerer kraftig analyse, brukervennlig grensesnitt og åpen kildekode for å gi deg den ultimate løsningen for eiendomsforvaltning.\n\n## Kraftig analyse for smarte beslutninger\n\nI hjertet av Propdock ligger vår avanserte analysemotor. Vi gir deg innsikt i:\n\n- Belegg og leieinntekter\n- Driftskostnader og vedlikeholdsutgifter\n- Markedstrender og verdivurderinger\n\nMed Propdock får du et 360-graders syn på din eiendomsportefølje, slik at du kan ta informerte beslutninger og maksimere avkastningen.\n\n<Image\n  alt="Propdocks analysedashboard"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/de9cf569-f767-4d0c-7b3e-21605769be00/public"\n  width={1607}\n  height={946}\n/>\n\n## Sømløse integrasjoner\n\nPropdock er designet for å passe sømløst inn i ditt eksisterende økosystem. Vi tilbyr integrasjoner med:\n\n- Regnskapssystemer\n- CRM-verktøy\n- Vedlikeholdsplanleggere\n- Og mye mer!\n\nVår fleksible arkitektur sikrer at Propdock vokser med dine behov.\n\n## Åpen kildekode for maksimal fleksibilitet\n\nVi tror på transparens og fellesskap. Propdock er fullstendig åpen kildekode, noe som betyr at du kan:\n\n- Tilpasse plattformen til dine spesifikke behov\n- Bidra til utviklingen og forme fremtiden til Propdock\n- Ha full kontroll over dine data og prosesser\n\nBesøk vårt [GitHub-repository](https://github.com/codehagen/propdock) for å utforske koden og bli en del av fellesskapet.\n\n## Start din Propdock-reise i dag\n\nEnten du forvalter en enkelt eiendom eller en omfattende portefølje, er Propdock skapt for å forenkle din hverdag og forbedre dine resultater.\n\n[Kom i gang gratis](https://propdock.no/) og opplev fremtiden innen eiendomsadministrasjon.',
