    content:
      'Å legge til en leietaker er en viktig del av eiendomsforvaltningen i Propdock. Følg denne veiledningen for å legge til en ny leietaker på en enkel og effektiv måte.\n\n## Steg 1: Naviger til Leietaker-seksjonen\n\n1. Logg inn på din Propdock-konto.\n2. Klikk på **Leietakere** i hovedmenyen.\n\n<Image\n  alt="Leietaker-seksjonen i Propdock"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/169cbf9b-92f6-4720-adce-6b843b7ad100/public"\n  width={1200}\n  height={675}\n/>\n\n## Steg 2: Legg til ny leietaker\n\n1. Klikk på **Legg til leietaker** knappen.\n2. Fyll ut følgende informasjon:\n   - Firmanavn (f.eks. SuperDuperCRM AS)\n   - Organisasjonsnummer\n   - Antall ansatte (valgfritt)\n\n<Note variant="warning">\n  En leietaker må alltid være tilknyttet en eiendom og en bygning. Sørg for at du har lagt til eiendommen og bygningen før du legger til leietakeren.\n</Note>\n\n3. Velg eiendommen og bygningen leietakeren skal knyttes til.\n4. Klikk på **Lagre** for å opprette leietakeren.\n\n## Steg 3: Legg til kontaktperson\n\nEtter at leietakeren er opprettet, må du legge til en kontaktperson.\n\n1. Klikk på den nyopprettede leietakeren for å åpne detaljvisningen.\n2. Finn seksjonen for kontaktpersoner og klikk på **Legg til kontaktperson**.\n3. Fyll ut kontaktinformasjonen for personen.\n\n<Note variant="info">\n  Kontaktpersonen er den som vil bli lagt til som hovedkontaktperson til leietakeren.\n</Note>\n\n## Neste steg\n\nNår du har lagt til leietakeren og kontaktpersonen, kan du utføre følgende handlinger:\n\n- Opprette en kontrakt for leietakeren\n- Sende dokumenter for e-signering\n- Fakturere leietakeren\n- Sende SMS til leietakeren\n\nFor mer informasjon om disse funksjonene, se våre relaterte artikler:\n\n- [Hvordan opprette en leiekontrakt](opprette-leiekontrakt)\n- [Sende dokumenter for e-signering](e-signering)\n- [Hvordan sende faktura](hvordan-sende-faktura)\n- [Kommunisere med leietakere via SMS](sende-sms-til-leietaker)\n\nHvis du støter på problemer eller har spørsmål om å legge til leietakere, ikke nøl med å [kontakte vår support](mailto:support@propdock.no).',
