    content:
      'Å opprette en leiekontrakt er en viktig del av prosessen når du leier ut eiendom. Propdock gjør denne prosessen enkel og effektiv. Følg denne veiledningen for å opprette en leiekontrakt.\n\n## Steg 1: Naviger til leietakeren\n\n1. Logg inn på din Propdock-konto.\n2. Gå til **Leietakere** i hovedmenyen.\n3. Finn og klikk på leietakeren du ønsker å opprette en kontrakt for.\n\n<Image\n  alt="Velg leietaker i Propdock"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/velg-leietaker/public"\n  width={1200}\n  height={675}\n/>\n\n## Steg 2: Start kontraktopprettelsen\n\n1. I leietakerens profilside, finn og klikk på **Kontrakt**-knappen.\n\n<Image\n  alt="Kontrakt-knappen i leietakerprofilen"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/kontrakt-knapp/public"\n  width={800}\n  height={400}\n/>\n\n## Steg 3: Fyll ut kontraktdetaljer\n\n1. Du vil nå se en venstre navigasjonsmeny med ulike seksjoner for kontrakten.\n2. Gå gjennom hver seksjon og fyll ut all nødvendig informasjon:\n   - Generell informasjon\n   - Leieperiode\n   - Leieobjekt\n   - Leiesum og betaling\n   - Særlige bestemmelser\n   - Vedlegg\n\n<Note variant="info">\n  Sørg for å fylle ut alle obligatoriske felt i hver seksjon for å kunne generere kontrakten.\n</Note>\n\n<Image\n  alt="Kontraktdetaljer i Propdock"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/kontraktdetaljer/public"\n  width={1000}\n  height={600}\n/>\n\n## Steg 4: Rediger kontrakten\n\n1. Etter at du har fylt ut alle nødvendige detaljer, klikk på **Editor**-knappen.\n2. I editor-visningen kan du se hele kontrakten og gjøre eventuelle siste justeringer.\n\n<Image\n  alt="Kontrakt-editor i Propdock"\n  src="https://imagedelivery.net/r-6-yk-gGPtjfbIST9-8uA/kontrakt-editor/public"\n  width={1200}\n  height={675}\n/>\n\n## Steg 5: Lagre kontrakten som PDF\n\n1. Når du er fornøyd med kontrakten, klikk på **Lagre PDF**-knappen.\n2. Velg hvor du vil lagre PDF-filen på din datamaskin.\n\n<Note variant="success">\n  Gratulerer! Du har nå opprettet en leiekontrakt i Propdock. Denne kan nå sendes til leietaker for gjennomgang og signering.\n</Note>\n\n## Neste steg\n\nEtter at du har opprettet leiekontrakten, kan du:\n\n- [Sende kontrakten for e-signering](e-signering)\n- [Legge til kontrakten i leietakerens profil](legge-til-dokumenter)\n- [Opprette fakturaer basert på kontrakten](hvordan-sende-faktura)\n\nHvis du støter på problemer eller har spørsmål om å opprette leiekontrakter, ikke nøl med å [kontakte vår support](mailto:support@propdock.no).',
