    content:
      '<Note variant="warning">\n  Denne funksjonen er for øyeblikket under utvikling og vil snart være tilgjengelig.\n</Note>\n\nPropdock Engine er vår banebrytende løsning som forenkler integrasjonen med flere regnskapssystemer gjennom én enkelt API. Dette gjør det mulig for utviklere og bedrifter å effektivt koble seg til og hente data fra ulike regnskapssystemer uten å måtte håndtere flere APIer.\n\n## Hovedfunksjoner\n\n- **Én API for alle**: Koble til Poweroffice, Fiken, Tripletex og flere med én enkelt integrasjon.\n- **Enhetlig dataformat**: Få data i et konsistent format uavhengig av kildesystemet.\n- **Enkel implementering**: Bruk vårt SDK for rask og enkel integrasjon i dine applikasjoner.\n- **Fleksibel bruk**: Send fakturaer direkte fra Excel, hent regnskapsdata, eller integrer med dine egne systemer.\n\n## Bruksområder\n\nMed Propdock Engine kan du:\n\n1. Sende fakturaer fra eksterne systemer som Excel.\n2. Hente og analysere regnskapsdata på tvers av systemer.\n3. Automatisere dataoverføring mellom ulike plattformer.\n4. Bygge skreddersydde rapporter og dashboards.\n\n## Kom i gang\n\nSelv om Propdock Engine fortsatt er under utvikling, kan du allerede nå forberede deg på å ta i bruk denne kraftige funksjonaliteten.\n\n### Eksempel på SDK-kall\n\n<Code title="Eksempel på SDK-kall" language="javascript">\n{`\nimport { Propdock } from \'propdock\';\n\nconst propdock = new Propdock({\n  token: "Propdock_API_KEY",\n});\n\n// Hent fakturaer fra alle tilkoblede systemer\nconst invoices = await propdock.getInvoices({\nstartDate: \'2024-01-01\',\nendDate: \'2024-12-31\'\n});\n\nconsole.log(invoices);\n`}\n</Code>\n\n\n\nDette enkle kallet vil hente fakturaer fra alle tilkoblede regnskapssystemer for hele året 2024, uavhengig av hvilket system de opprinnelig ble opprettet i.\n\n## Fremtidige muligheter\n\nVi jobber kontinuerlig med å utvide funksjonaliteten i Propdock Engine. Noen planlagte funksjoner inkluderer:\n\n- Sanntidssynkronisering av data\n- Avanserte filtreringsmuligheter\n- Støtte for flere regnskapssystemer\n\n## Hold deg oppdatert\n\nVil du være blant de første til å ta i bruk Propdock Engine? Registrer din interesse nå:\n\n\nVi vil holde deg oppdatert om utviklingen og gi deg tidlig tilgang når funksjonen er klar for lansering.\n\nHar du spørsmål eller ønsker om funksjonalitet? [Kontakt vårt utviklerteam](mailto:dev@propdock.no) - vi setter pris på din input!',
